import React from 'react';
import './App.css';
import Navigation from "./ui/menu/Navigation/Navigation";
import {BrowserRouter, Route, Routes, Navigate} from "react-router-dom";
import {Terminal} from "./pages/Terminal/Terminal";
import {SwitchDetails} from "./pages/SwitchDetails/SwitchDetails";
function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <Navigation />
                <Routes>
                    <Route path=":dorm/:floor/:switch/terminal">
                        <Terminal></Terminal>
                    </Route>
                    <Route path=":dorm/:floor/:switch">
                        <SwitchDetails></SwitchDetails>
                    </Route>
                    <Route path="">
                        <h1>Choose the switch in navigation list... Looser</h1>
                    </Route>
                    <Navigate to="" />
                </Routes>
            </div>
        </BrowserRouter>
    );
}

export default App;
